!function(t) {
    function n() {
        t("select").select2({
            minimumResultsForSearch: 1 / 0
        });
    }
    function e() {
        t("input[type='tel']").intlTelInput({
            initialCountry: "na",
            onlyCountries: [ "za", "na" ],
            utilsScript: "/js/utils.js",
            separateDialCode: !0
        });
    }
    function i() {
        window.setTimeout(function() {
            t(".alert").animate({
                right: "-100%"
            }, 1e3, function() {
                t(this).remove();
            });
        }, 5e3);
    }
    t(document).ready(function() {
        n(), e(), i();
    });
}(jQuery);